css:
@-moz-document domain("youtube.com") {
.html5-scrubber-button,
.ytp-scrubber-button {
    background: url(data:image/gif;base64,)no-repeat center!important;
    width: 46px !important;
    height: 38px !important;
    border: none !important;
    margin-left: -5px !important;
    margin-top: -9px !important;
    transform: scale(1)!important;
}

.html5-play-progress,
.ytp-play-progress {
    background: #fff!important;
}

.ytp-progress-bar-container {
    bottom: 38px!important;
}

.html5-progress-bar-container,
.ytp-progress-bar-container {
    height: 12px !important;
}

.html5-progress-bar,
.ytp-progress-bar {
    margin-top: 12px !important;
}

.html5-progress-list,
.ytp-progress-list,
.video-ads .html5-progress-list.html5-ad-progress-list,
.video-ads .ytp-progress-list.ytp-ad-progress-list {
    height: 12px !important;
}
}

